import React from "react";

import Layout from "../components/Layout";
import Projects from "../components/Projects";

const ProjectsPage = () => {
  // eslint-disable-next-line react/react-in-jsx-scope
  return (
    <Layout>
      <Projects />
    </Layout>
  );
};

export default ProjectsPage;
